def _convert_key(self, key, is_setter: bool = False):
        """
        Require the keys to be of the same type as the index. (so we don't fallback)
        """
        if is_setter:
            return list(key)

        for ax, i in zip(self.obj.axes, key):
            if isinstance(ax, pd.DatetimeIndex):
                if not pd.api.types.is_datetime64_any_dtype(i):
                    raise ValueError(
                        "At based indexing on a datetime index can only have datetime indexers"
                    )
            elif isinstance(ax, pd.TimedeltaIndex):
                if not pd.api.types.is_timedelta64_any_dtype(i):
                    raise ValueError(
                        "At based indexing on a timedelta index can only have timedelta indexers"
                    )
            else:
                if not pd.api.types.is_numeric(i):
                    raise ValueError(
                        "At based indexing on a numeric index can only have numeric indexers"
                    )

        return key
